import styled from 'styled-components';

export const Container = styled.div`
    flex: 1;
    display: flex;
    align-items: center;
    justify-content: center;

`;

export const Form = styled.div`
    width: 90%;
    max-width: 500px;
    background-color: #ccc;
    margin-left: 5%;
    border: 1px solid #ccc;

`;

export const Title = styled.h1`
    font-size: 20px;
    font-weight: bold;
    margin-top: 5px;


`;
